create table ACCOUNT (
  ID integer primary key AUTO_INCREMENT ,
  NAME text not null,
  ADDRESS text,
  PHONE text,
  BALANCE real
);

create table BANK_TRANSACTIONS(
  ID integer primary key AUTO_INCREMENT,
  ID_SENDER integer not null,
  ID_RECEIVER integer not null,
  SENDER_BALANCE_BEFORE real not null,
  SENDER_BALANCE_AFTER real not null,
  RECEIVER_BALANCE_BEFORE real not null,
  RECEIVER_BALANCE_AFTER real not null,
  AMOUNT_TRANSFERRED real not null,
    foreign key (ID_SENDER) references ACCOUNT(ID),
    foreign key (ID_RECEIVER) references ACCOUNT(ID)
);


